import logo from './logo.svg';
import {route, Route, BrowserRouter} from 'react-router-dom';
import React from 'react';
import LoginSignUp from './components/LoginSignup';
import './App.css';

function App() {
  return (
    <div>
      <BrowserRouter>
      <router>
        <route path="/login" element={<LoginSignUp/>}/>
      </router>
      </BrowserRouter>

    </div>
  );
}

export default App;
